            <p>January '14 - November '15</p>
            <p>~ 2 years</p>
            <p>________________________________________</p>
            <h6>Practical Lesson Demonstrator</h6>
            <p>________________________________________</p>
            <p>Stellenbosch University</p>
        </div>
    );
}

export default WorkExp4;
